const Post = () => (
    <div className = "bg-white bg-opacity-60 rounded-2xl w-full p-4">
        <div className = "w-full flex space-around font-bold">
            <h1 className = "w-1/2">user</h1>
            <h2 className >{new Date().toLocaleDateString()}</h2>
        </div>
        <h1>Post</h1>
    </div>
)

export default Post;
